import React from 'react';

import ExpenseItem from "./ExpenseItem";
import './Expenses.css';
import './ExpenseFilter';
import Card from "../UI/Card";
import ExpenseFilter from './ExpenseFilter';

const Expenses=(props)=> {


  const changeFilterhandler=(selectedYear)=>{
    console.log(selectedYear);
  }

  const filteredExpenses=props.items.filter((expense)=>{
    return expense.date.getFullYear().toString() === filteredYear;
  })

  return (

    <Card className="expenses">
      <ExpenseFilter onChangeFilter={changeFilterhandler} ></ExpenseFilter>
      {props.items.map((singleexpense)=>
      <ExpenseItem key={singleexpense.id} title={singleexpense.title} amount={singleexpense.amount} date={singleexpense.date}></ExpenseItem>)
      }    

    </Card>
  );
}

export default Expenses;
